import React from 'react';
import ReactDOM from 'react-dom';
import { AppBar, Toolbar, Typography, IconButton } from 'material-ui';


export default props => (
    <AppBar position="static">
        <Toolbar>
     
            <Typography variant="h2" color="inherit">
                Header info
            </Typography>
          
        </Toolbar>
    </AppBar>
);
